import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <aside>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/uploads">Uploads</Link>
          </li>
        </ul>
      </nav>
    </aside>
  );
};

export default Sidebar;
